import styled from 'styled-components';

const QuestionItemNumButton = styled.div`
  margin-right: 30px;
`;

const QuestionItemNumButtonCircle = styled.div`
    margin-right: 15px;
    width: 20px;
    height: 20px;
    border-radius: 20px;
    border: 5px solid blue;
    display: inline-block;
`;

const QuestionItemNumButtonText = styled.div`
  font-size: 17px;
  display: inline-block;
  font-weight: bold;
`;

export default function QuestionItemNum(props) {
    return (
      <>
        <QuestionItemNumButton>
          <QuestionItemNumButtonCircle/>
          <QuestionItemNumButtonText>{props.num}</QuestionItemNumButtonText>
        </QuestionItemNumButton>
      </>
    );
}
